■デッキライト 集魚灯 サーチライトの取付けに<BR> ■船や車の本体に穴を開ける事なくライトの取付けが可能になります<BR> ■小型のブラケットですので、小口径のパイプに取り付けやすくなりました<BR> ■パイプ径31mmまで対応<BR> ■付属のゴムアタッチメントで19mm 22mm 25mmのパイプに無加工で取付け可能<BR> ■ライト取付け穴は10.2mmですので、ほとんどのライトが取付け出来ます<BR> <BR> ・品番：KNGP-31mm<BR> ・寸法：奥行76mm 厚み12mm 幅22mm<BR> ・重量：100g<BR> ・材質：アルミ<BR> <BR> <font color="white">bracket</font><style type="text/css">

/*買い物かごに入れるボタン*/
#rakutenLimitedId_aroundCart input[value="買い物かごに入れる"]{
background: url("http://image.rakuten.co.jp/auc-ksgarage/cabinet/common/kyoutuu/btn_cart2.jpg") left top no-repeat;
width:216px;
height:70px;
text-indent:100%;
white-space:nowrap;
overflow:hidden;
border: none;
padding:0;
margin-top:5px 0;
cursor:pointer;
}
#rakutenLimitedId_aroundCart tbody tr td input:hover{
alpha(opacity=8);
-moz-opacity:0.8;
opacity:0.8;
cursor:pointer;
}

/*商品問合わせボタン*/
#rakutenLimitedId_aroundCart input[value="商品についての問合わせ"]{
background: url("http://image.rakuten.co.jp/auc-ksgarage/cabinet/common/kyoutuu/btn_mail2.jpg") left top no-repeat;
width:300px;
height:95px;
text-indent:100%;
white-space:nowrap;
overflow:hidden;
border: none;
padding:0;
margin-top:5px 0;
cursor:pointer;
}

/* お気に入り商品差し替えタグ */
#rakutenLimitedId_aroundCart #serviceTableSml td.favorite {
padding-top: 5px;
}
#rakutenLimitedId_aroundCart div.bookmarkArea div.bkm {
width: 300px !important;
height:75px !important;
padding: 0px 0px 10px 0px !important;
}
#rakutenLimitedId_aroundCart div.bookmarkArea div.bkm a.addBkm {
width: 300px !important;
height:75px !important;
}
#rakutenLimitedId_aroundCart div.bookmarkArea div.bkm a.addBkm span.bkmStar {
display: inline-block !important;
width: 300px !important;
height:75px !important;
margin:0px 0px 10px 0px !important;
background: url("http://image.rakuten.co.jp/auc-ksgarage/cabinet/common/kyoutuu/btn_item2.jpg") no-repeat !important;
}

/* お気に入りショップ差し替えタグ */
div.bookmarkArea {
width: 300px !important;
}
#rakutenLimitedId_aroundCart div.shopBookmarkArea div.shopBkm {
width: 300px !important;
height:75px !important;
padding: 0px 0px !important;
padding-left: 0px !important;
}
#rakutenLimitedId_aroundCart div.shopBookmarkArea div.shopBkm a.addShopBkm span.shopBkmStar {
display: inline-block !important;
width: 300px !important;
height:75px !important;
margin-right: 0px !important;
background: url("http://image.rakuten.co.jp/auc-ksgarage/cabinet/common/kyoutuu/btn_shop2.jpg") no-repeat !important;
}

</style>

